  JWILLIAMS, Edward Egerton and ANDERSON, Nancy
  02> WILLIAMS, Keith Maxwell
  b 21.08.1954
  Keith was educated at Rosmini College and Westlake High School, Auckland, then studied at Auckland
  Technical Institute while serving an apprenticeship with Phillips Electrical. He emigrated to
  Sydney in 1976 where he has acted as acoustics engineer, consultant and architect for the
  construction of several recording studios, including Richmond Recorders, Melbourne, Chinatown
  Recording Studios and Rich Music Studios, Sydney. He is now living in Byron Bay where he is
  designing and constructing another suite of recording studios.
  02> WILLIAMS, Edward Egerton m on 16.05.1969 to (2)CLARK, Gwen
  b 16.01.1928
  b 08.07.1942
  Divorced. Gwen, d/o Ray Clark and Mina Hammonds. Address: PO Box 7184, Te Ngae, Rotorua.
  01> WILLIAMS, Nicola Mina m on ** ** **** to GEARY, Dave
  b 14.03.1970
  b ** ** ****
  Nicola is working for the Forest Research Institute in Rotorua and studying to graduate BScTech
  from the University of Waikato.
  02> WILLIAMS, Raymond Claud
  b 02.02.1972
  Address: 14 Blease Street, New Lynn, Auckland,
  Raymond is working for Trower Industries Ltd in Auckland.
  03> WILLIAMS, Brian Fenton
  b 26.07.1975
  Address: 42 Liston Crescent, Hamilton.
  03> WILLIAMS, Stella Frances m on 23.02.1963 to OVERBYE, Jon Douglas
  b 26.07.1939
  b 04.11.1929
  Stella b, at Gisborne and m. at Holy Trinity Church, Gisborne. Divorced 18.06.1988. Jon, s/o Douglas L
  Overbye and Masie Ekdahl. Address: 55 Shelley Road, Gisborne.
  Stella was educated at Queenswood School, Hastings, and Nga Tawa, Masterton. She studied English
  Literature and graduated MA from Otago University in 1962. She worked for a time at the Gisborne
  Public Library then lived and worked at Pakama Orchard, Waegenga-a-hika from 1964 until 1988. During
  1972-87 she developed and ran an extensive mail order business in citrus fruits. She moved into
  Gisborne in 1989 and attended Tairawhiti Polytechnic where she completed eight papers towards a New
  Zealand Certificate in Business Studies. In 1993-95 she was a resident student at the Bible College of
  New Zealand in Henderson, graduating with a Bachelor of Ministries in 1996. She is currently working
  part-time as a care-giver for the aged, and involved in lay ministry at Holy Trinity, Gisborne. Since
  1997 she has also been acting as co-ordinator for BCNZ extension studies in Gisborne.
  01> OVERBYE, Carl Vincent m on 01.04.1989 to MILLS, Dorraine
  b 12.08.1963
  b 02.06.1964
  Carl b. at Gisborne and m, at Perth. Dorraine d/o Ross Mills and Lorraine Maude Prendergast.
  Address: (temporary) 8 Gummow Way, Girrawheen 6064, Western Australia.
  Carl graduated from Massey University with a BHortSc in 1985. He is employed by Edith Cowan
  University, Perth, as Grounds Maintenance Manager after being originally employed as a temporary
  gardener in 1987, and also serving eight years as Grounds Foreman.
  Dorraine works full time as a mother and part time as a receptionist. They attend Cityside
  Christian Church.
